ga3d(){return"The structures of Chichen Itza were built from precisely chiseled limestone blocks that fit together perfectly without the mortar. Many of these stone buildings were originally painted in red, green, blue and purple colors depending on the availability of the pigments.\nThe stepped pyramid El Castillo stands about 98 feet (30 m) high and consists of a series of nine square terraces, each approximately 8.4 feet (2.57 m) high, with a 20 foot (6 m) high temple upon the summit."},
ga3e(){return"It was built upon broken terrain, which was artificially leveled to support structures such as the Castillo pyramid. Important buildings within the center were connected by a dense network of paved roads called sacbeob."},
ga3h(){return"Chichen Itza is located in the eastern portion of Yucat\xe1n state in Mexico. Nearby, four large sinkholes, called cenotes, could have provided plentiful water year round at Chichen, making it attractive for settlement."},
ga3i(){return'Of these cenotes, the "Cenote Sagrado" or Sacred Cenote, was used for the sacrifice of precious objects and human beings as a form of worship to the Maya rain god Chaac.'},
ga36(){return"Chichen Itza rises to regional prominence toward the end of the Early Classic period"},
ga37(){return"The earliest hieroglyphic date discovered at Chichen Itza"},
ga38(){return"Last known date recorded in the Osario temple"},
ga33(){return"Chichen Itza declines as a regional center"},
ga34(){return"Invaded by Spanish Conquistador Francisco de Montejo"},
ga35(){return"All Spanish are driven from the Yucat\xe1n Peninsula"},
